INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (27, "ヒヨリ", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 2, "人助け、応援", 0, "A", 155, "人助けが大好き！　前向き格闘娘", 100101, "東山奈央", "トゥインクルウィッシュ", "獣人族", 44, 16);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (5, "ユイ", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 2, "料理、人間観察", 0, "O", 158, "戦闘のサポートが得意な、心優しい少女", 100201, "種田梨沙", "トゥインクルウィッシュ", "ヒューマン", 47, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (12, "レイ", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 2, "読書、乗馬、お茶", 0, "B", 163, "クールで何事にも真っ直ぐな剣士", 100301, "早見沙織", "トゥインクルウィッシュ", "魔族", 46, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "ミソギ", 8, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 5, "いたずら、探検", 0, "O", 128, "探検好きのイタズラっ子", 100401, "諸星すみれ", "リトルリリカル", "ヒューマン", 27, 9);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (25, "マツリ", 11, "？？？", 8, "ヒーローごっこ", 0, "O", 146, "ヒーローに憧れる騎士見習いの少女", 100501, "下田麻美", "王宮騎士団（NIGHTMARE）", "獣人族", 40, 12);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (22, "アカリ", 11, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 7, "サックス", 0, "O", 150, "甘え上手なみんなの人気者", 100601, "浅倉杏美", "悪魔偽王国軍（ディアボロス）", "魔族", 42, 13);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (23, "ミヤコ", 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 7, "プリンを食べること", 0, "B", 130, "プリン大好きゴースト娘", 100701, "雨宮天", "悪魔偽王国軍（ディアボロス）", "魔族", 32, 14);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "ユキ", 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 15, "鏡で自分を見ること", 0, "AB", 150, "ボクは誰よりも美しい", 100801, "大空直美", "ヴァイスフリューゲル　ランドソル支部", "エルフ", 40, 14);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (5, "アンナ", 7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 13, "小説執筆", 0, "A", 159, "前世を信じる中二病患者、「疾風の冥姫」", 100901, "髙野麻美", "トワイライトキャラバン", "魔族", 45, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (22, "マホ", 9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 10, "空想、ぬいぐるみ集め", 0, "O", 155, "マホマホ王国のプリンセス", 101001, "内田真礼", "自警団（カォン）", "獣人族", 42, 16);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (25, "リノ", 8, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 3, "お裁縫", 0, "A", 156, "人懐っこくてマシンガントークな妹系少女", 101101, "阿澄佳奈", "ラビリンス", "ヒューマン", 44, 15);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (24, "ハツネ", 12, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 6, "妹と遊ぶこと、二度寝、昼寝、早寝", 0, "A", 156, "みんなのために超能力を使う眠り姫", 101201, "大橋彩香", "フォレスティエ", "エルフ", 46, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (21, "ナナカ", 8, "", 13, "読書、魔法", 0, "O", 166, "オタク全開な魔法少女", 101301, "佳村はるか", "トワイライトキャラバン", "魔族", 55, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "カスミ", 11, "test", 10, "読書、推理", 0, "AB", 152, "頭脳明晰な美少女名探偵", 101401, "水瀬いのり", "自警団（カォン）", "獣人族", 41, 15);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (5, "ミサト", 9, "test", 6, "絵本作り", 0, "O", 165, "母性溢れる優しいみんなの「ミサト先生」", 101501, "國府田マリ子", "フォレスティエ", "エルフ", 54, 21);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "スズナ", 4, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 14, "ファッション", 0, "O", 167, "天真爛漫で人気者のカリスマモデル", 101601, "上坂すみれ", "ルーセント学院", "魔族", 48, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (7, "カオリ", 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 10, "踊り、空手", 0, "A", 158, "いつでも「なんくるないさ～」な天然娘", 101701, "高森奈津美", "自警団（カォン）", "獣人族", 53, 19);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (14, "イオ", 8, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 0, "B", 162, "多くの男性を魅了する無垢な女教師", 101801, "伊藤静", "ルーセント学院", "魔族", 52, 23);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "ミミ", 4, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 5, "かわいいもの集め", 0, "O", 117, "お歌もにんじんも、ウサギさんも大好き♪", 102001, "日高里菜", "リトルリリカル", "獣人族", 21, 10);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (9, "クルミ", 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "観劇、おままごと", 0, "B", 150, "泣き虫で臆病な守ってあげたい女の子", 102101, "植田佳奈", "サレンディア救護院", "ヒューマン", 40, 12);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (22, "ヨリ", 11, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 7, "ゲーム全般", 0, "O", 150, "人見知りであまのじゃくな女の子", 102201, "原紗友里", "悪魔偽王国軍（ディアボロス）", "魔族", 40, 13);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "アヤネ", 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 9, "屋内でできる遊び", 0, "B", 148, "ぷうきちといつも一緒！", 102301, "芹澤優", "サレンディア救護院", "ヒューマン", 38, 14);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (12, "スズメ", 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 9, "ご奉仕", 0, "O", 154, "お嬢さまのためにがんばるドジっ娘メイド", 102501, "悠木碧", "サレンディア救護院", "ヒューマン", 43, 15);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "リン", 1, "test", 11, "あんパン", 0, "B", 144, "遊びと睡眠が何より大事なぐうたら娘", 102601, "小岩井ことり", "牧場（エリザベスパーク）", "獣人族", 42, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (30, "エリコ", 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 13, "実験、裁縫、料理", 0, "B", 154, "運命の相手に一途すぎる乙女", 102701, "橋本ちなみ", "トワイライトキャラバン", "魔族", 43, 16);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (4, "サレン", 10, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 9, "経営、お茶会", 0, "A", 156, "救護院を経営する優しい庶民派お嬢様", 102801, "堀江由衣", "サレンディア救護院", "エルフ", 43, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (24, "ノゾミ", 1, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 4, "舞台鑑賞、ダンス", 0, "B", 157, "歌って踊れる大人気アイドル", 102901, "日笠陽子", "カルミナ", "ヒューマン", 40, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (31, "ニノン", 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 15, "忍法開発", 0, "O", 163, "トーゴクの神秘、オシエテクダサイ！", 103001, "佐藤聡美", "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", 51, 16);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (22, "シノブ", 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 7, "占い", 0, "AB", 157, "占いが得意な霊能少女", 103101, "大坪由佳", "悪魔偽王国軍（ディアボロス）", "魔族", 42, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (12, "アキノ", 3, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 12, "慈善事業", 0, "AB", 157, "一人前の商人を目指すパワフルお嬢様", 103201, "松嵜麗", "メルクリウス財団", "ヒューマン", 45, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "マヒル", 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 11, "漫才", 0, "B", 142, "みんなを笑顔にするお笑い牧場主", 103301, "新田恵海", "牧場（エリザベスパーク）", "ヒューマン", 35, 20);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (16, "ユカリ", 3, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 12, "ウインドーショッピング", 0, "A", 164, "純情でほっとけない大人の女性", 103401, "今井麻美", "メルクリウス財団", "エルフ", 55, 22);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (2, "キョウカ", 2, "test", 5, "お勉強", 0, "A", 118, "礼儀正しくしっかり者のちびっ子優等生", 103601, "小倉唯", "リトルリリカル", "エルフ", 21, 8);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "トモ", 8, "test", 8, "剣術、年長者をからかう", 0, "A", 149, "義理堅くてからかい好きな剣術少女", 103701, "茅原実里", "王宮騎士団（NIGHTMARE）", "ヒューマン", 43, 13);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "シオリ", 11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 11, "読書、お散歩", 0, "A", 153, "読書が趣味の病弱少女", 103801, "小清水亜美", "牧場（エリザベスパーク）", "獣人族", 40, 14);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (6, "アオイ", 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, "友達作りのイメトレ", 0, "AB", 158, "「友達」に憧れる、エルフの森の女の子", 104001, "花澤香菜", "フォレスティエ", "エルフ", 44, 13);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "チカ", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 4, "各種楽器", 0, "O", 163, "人々を守るために歌う、唱喚士の少女", 104201, "福原綾香", "カルミナ", "ヒューマン", 46, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (9, "マコト", 8, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 10, "お菓子作り", 0, "O", 168, "男勝りで情に厚いワイルド娘", 104301, "小松未可子", "自警団（カォン）", "獣人族", 54, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (5, "イリヤ", 5, "test", 7, "世界征服", 0, "A", 172, "かつては夜を支配した最強の吸血鬼", 104401, "丹下桜", "悪魔偽王国軍（ディアボロス）", "魔族", 50, "??");
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (19, "クウカ", 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 15, "小説を読むこと", 0, "AB", 157, "妄想大好き！　ほんとは照れ屋な女の子", 104501, "長妻樹里", "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", 49, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "タマキ", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 12, "猫とたわむれること", 0, "AB", 158, "弱きを助け強きをくじく猫娘", 104601, "沼倉愛美", "メルクリウス財団", "獣人族", 48, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (25, "ジュン", 10, "？？？", 8, "格闘技、湯浴み", 0, "A", 171, "素顔を見せない冷静沈着な女性騎士", 104701, "川澄綾子", "王宮騎士団（NIGHTMARE）", "ヒューマン", 50, 25);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "ミフユ", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 12, "傭兵などのアルバイト", 0, "O", 163, "仕事も私事も効率優先な傭兵少女", 104801, "田所あずさ", "メルクリウス財団", "ヒューマン", 49, 20);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (24, "シズル", 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 3, "家事全般", 0, "O", 168, "お姉ちゃんがお世話してあげるからねっ！", 104901, "生天目仁美", "ラビリンス", "ヒューマン", 54, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "ミサキ", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 14, "ファッション誌鑑賞、コスメ集め", 0, "A", 120, "ちょっとおませな恋に恋する女の子", 105001, "久野美咲", "ルーセント学院", "魔族", 22, 11);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (7, "ミツキ", 3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 13, "研究、実験", 0, "A", 166, "実験が趣味の危険な科学者", 105101, "三石琴乃", "トワイライトキャラバン", "ヒューマン", 53, 27);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (14, "リマ", 3, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 11, "毛繕い、お喋り", 0, "A", 150, "乙女チックなもふもふアニマル", 105201, "徳井青空", "牧場（エリザベスパーク）", "獣人族", 100, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (28, "モニカ", 7, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 15, "お菓子屋通い", 0, "A", 140, "見た目も中身もお子ちゃまな異国の軍人", 105301, "辻あゆみ", "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", 33, 18);
