INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "タマキ（サマー）", 3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 12, "猫とたわむれること", 0, "AB", 158, "弱きを助け強きをくじく猫娘", 107901, "沼倉愛美", "メルクリウス財団", "獣人族", 48, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "ミフユ（サマー）", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 12, "傭兵などのアルバイト", 0, "O", 163, "仕事も私事も効率優先な傭兵少女", 108001, "田所あずさ", "メルクリウス財団", "ヒューマン", 49, 20);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (22, "シノブ（ハロウィン）", 12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 7, "占い", 0, "AB", 157, "占いが得意な霊能少女", 108101, "大坪由佳", "悪魔偽王国軍（ディアボロス）", "魔族", 42, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (23, "ミヤコ（ハロウィン）", 1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 7, "プリンを食べること", 0, "B", 130, "プリン大好きゴースト娘", 108201, "雨宮天", "悪魔偽王国軍（ディアボロス）", "魔族", 32, 14);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "ミサキ（ハロウィン）", 1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 14, "ファッション誌鑑賞、コスメ集め", 0, "A", 120, "ちょっとおませな恋に恋する女の子", 108301, "久野美咲", "ルーセント学院", "魔族", 22, 11);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "チカ（クリスマス）", 6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 4, "各種楽器", 0, "O", 163, "人々を守るために歌う、唱喚士の少女", 108401, "福原綾香", "カルミナ", "ヒューマン", 46, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (9, "クルミ（クリスマス）", 6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "観劇、おままごと", 0, "B", 150, "泣き虫で臆病な守ってあげたい女の子", 108501, "植田佳奈", "サレンディア救護院", "ヒューマン", 40, 12);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "アヤネ（クリスマス）", 5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 9, "屋内でできる遊び", 0, "B", 148, "ぷうきちといつも一緒！", 108601, "芹澤優", "サレンディア救護院", "ヒューマン", 38, 14);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (27, "ヒヨリ（ニューイヤー）", 8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 2, "人助け、応援", 0, "A", 155, "人助けが大好き！　前向き格闘娘", 108701, "東山奈央", "トゥインクルウィッシュ", "獣人族", 44, 16);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (5, "ユイ（ニューイヤー）", 4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 2, "料理、人間観察", 0, "O", 158, "戦闘のサポートが得意な、心優しい少女", 108801, "種田梨沙", "トゥインクルウィッシュ", "ヒューマン", 47, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (12, "レイ（ニューイヤー）", 1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 2, "読書、乗馬、お茶", 0, "B", 163, "クールで何事にも真っ直ぐな剣士", 108901, "早見沙織", "トゥインクルウィッシュ", "魔族", 46, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (30, "エリコ（バレンタイン）", 7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 13, "実験、裁縫、料理", 0, "B", 154, "運命の相手に一途すぎる乙女", 109001, "橋本ちなみ", "トワイライトキャラバン", "魔族", 43, 16);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (24, "シズル（バレンタイン）", 10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 3, "家事全般", 0, "O", 168, "お姉ちゃんがお世話してあげるからねっ！", 109101, "生天目仁美", "ラビリンス", "ヒューマン", 54, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "アン", 12, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "", "読書", 0, "AB", 156, "英霊と契約を結んだマナリアの天才王女", 109201, "日笠陽子", "？？？", "ヒューマン", 55, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (4, "ルゥ", 2, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "", "食べること、眠ること", 0, "O", 144, "マナリア魔法学院の新入生", 109301, "こやまきみこ", "？？？", "ヒューマン", 45, 15);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "グレア", 11, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "", "ピアノ", 0, "B", 167, "人を超越した力を有す心優しい竜姫", 109401, "福原綾香", "？？？", "半人半竜", 67, 17);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (19, "クウカ（オーエド）", 11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 15, "小説を読むこと", 0, "AB", 157, "妄想大好き！　ほんとは照れ屋な女の子", 109501, "長妻樹里", "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", 49, 18);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (31, "ニノン（オーエド）", 8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 15, "忍法開発", 0, "O", 163, "トーゴクの神秘、オシエテクダサイ！", 109601, "佐藤聡美", "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", 51, 16);
